-- Creando ENTIDADES
CREATE TABLE entidad (
   n_id_organ NUMBER(12),
   d_fecacc DATE,
   c_sector VARCHAR2(10),
   c_nomorg VARCHAR2(500),
   c_nroruc NUMBER(20),
   c_dirfis VARCHAR(1000),
   n_id_ubigeo NUMBER(12),
   CONSTRAINT entidad_pk PRIMARY KEY(n_id_organ),
   CONSTRAINT ent_ubi_fk FOREIGN KEY (n_id_ubigeo) REFERENCES ubigeo(n_id_ubigeo)
);


